$(document).ready(function() {
    _tabs.init(); /* 
     ._tabs-nav :   >li>a id ='val'
     ._tabs :   div id ='val'
     */
    _slider._init();/* 
     ._owl-slider :   
    */
    _nav_resize._init(); //  
    _nav_resize2._init(); //  
    _engPopup._init();
    _btn.init();
    _button_scroll_top.init();
    _resize.init();
});
var _tabs = {
    init: function () {
        this.tabs = $('._tabs');
        this.tabsNav = $('._tabs-nav');
        this.tabsContent = $('._tabs-content');

        this.tabsNav_ar = this.tabsNav.find('a');
        this.tabsContent_ar = this.tabsContent.find('._tab');

        _tabs.load();

        this.tabsNav_ar.each(function(index, element){
            $(element).on('click', _tabs.click);
        });
    },
    load: function () {
        _tabs.tabs.each(function(index, element){
            $(element).attr('_tabs-data-id',index);

            $(element).find('._tab').removeClass('active');

            if($(element).find('a.active').length !== Number(1)){
                $(element).find('a').removeClass('active');
                $(element).find('a').filter(':first').addClass('active');
            }

            var id = $(element).find('a.active').attr('href');
            $(element).find('._tab'+id).addClass('active');
        });
    },
    click: function (e){
        e.preventDefault();
        var id = $(this).attr("href"),
            tab = _tabs.tabsContent.find(id),
            tabs = tab.parents('._tabs[_tabs-data-id]');

        _tabs.update(tabs);

        $(this).addClass('active');
        tab.addClass('active');

    },
    update: function (_this) {
        _this.find('._tabs-nav a').removeClass('active');
        _this.find('._tabs-content ._tab').removeClass('active');
    }
};
var _slider = {
    _init: function () {
        $('._owl-slider').owlCarousel({
            loop:true,
            items:1, // 
            autoplay:true, //  
            autoplayTimeout:8000, //  
            autoplayHoverPause:false, // .  
			nav: true,
            navText: [
                "<img src='/local/templates/main/images/elSlider-back.svg'>",
                "<img src='/local/templates/main/images/elSlider-next.svg'>"
            ]			
        });
        $('.owl-carousel').owlCarousel({
            loop:true,
            autoWidth:true,

            autoplay:false, // 
            autoplayTimeout:5000, //  
            responsiveClass:true, //   
            responsive:{
                0:{
                    items:1,
                    center:true
                },
                600:{
                    items:1,
                    margin:50
                },
                870:{
                    items:2,
                    margin:50
                },
                1200:{
                    items:2,
                    margin:30
                }
            },
            navText: [
                "",
                "<img src='/local/templates/main/images/elSliderLink-next.svg'>"
            ]
        });
    }
};
var _resize = {
    init: function () {
        this.width = 0;
        this.arElements = $('[data-resize]');
        this.arResize = [];

        this.load();
    },
    load: function () {

        this.arElements.each(function(index, element){
            _resize.arResize[index] = [element];
        });

        this.resize();
        $(window).resize(this.resize);
    },
    resize: function() {
        _resize.width = $(document).width()+5;


        for (var i in _resize.arResize) {
            var _this = _resize.arResize[i];

            var name = $(_this).attr('data-resize');
            var size = $(_this).attr('data-resize-width');

            var before = $('[data-resize='+name+']');
            var after = $('[data-resize-after='+name+']');

            if($(after).children().length<1) {}
            
            if(_resize.width < size){
                var block = before.children();

                block.detach();after.prepend(block);
            }else{
                var block = after.children();

                block.detach();before.prepend(block);
            }
        };
    }
};
var _nav_resize = {
    _init: function () {
        this.menu = $('[_nav_resize]');
        this.menu_wight = this.menu.width();
        this.wight = 0;

        this.menu_after = $('[_nav_resize_after]');
        this.arMenuItem = this.menu.find('>li');

        this.resize();
    },
    resize: function () {
        _nav_resize.arMenuItem.each(function(indx, element){
            var temp_wight = $(element).width();
            _nav_resize.wight = _nav_resize.wight + temp_wight;

            if(_nav_resize.menu_wight <= _nav_resize.wight){
                $(element).detach();
                _nav_resize.menu_after.prepend($(element));
            }
        });
    }
};
var _nav_resize2 = {
    _init: function () {
        this.menu = $('[_nav_resize2]');
        this.menu_wight = this.menu.width();
        this.wight = 0;

        this.menu_after = $('[_nav_resize_after2]');
        this.arMenuItem = this.menu.find('li');

        this.resize();
    },
    resize: function () {
        _nav_resize2.arMenuItem.each(function(indx, element){
            var temp_wight = $(element).width();
            _nav_resize2.wight = _nav_resize2.wight + temp_wight;

            if(_nav_resize2.menu_wight <= _nav_resize2.wight){
                $(element).detach();
                _nav_resize2.menu_after.prepend($(element));
            }
        });
    }
};
var _engPopup = {
    _init: function () {
        $("[eng-popup]").fancybox({
            speed : 330,
            opacity : 'auto',
        });
    }
};
var _btn = {
    init: function () {
        this.btn = $('._btn');
        this.btnSwitchParent = $('.bx-filter .sections>ul>li span');
        this.btnMenu = $('.elHeaderBody-menu .btn_select-list');

        this.load();
    },
    load: function () {
        _btn.btnSwitchParent.each(function(index, element){
            var activeBlock = $(element).parent();

            $(element).on('click', function(){
                event.preventDefault();
                _btn.click(activeBlock) ;
            });
        });

        _btn.btnMenu.each(function(index, element){
            var activeBlock = $(element).parent();

            $(element).on('click', function(){
                event.preventDefault();
                _btn.click(activeBlock) ;
            });
        });
    },
    click: function (_this) {

        if (_this.hasClass('active')) {
            $(_this).removeClass('active');
        } else {
            $(_this).addClass('active');
        }
    }
};



var _button_scroll_top = {
    init: function () {
        this.button = $('._button-scroll-top');

        $(this.button).on('click', this.scroll);

        $(window).scroll(function() {
            if($(this).scrollTop() >= 100) {
                _button_scroll_top.button.fadeIn();
            } else {
                _button_scroll_top.button.fadeOut();
            }
        });
    },
    scroll: function () {
        $('body,html').animate({scrollTop: 0}, 800);
    }
}



